    "a-summary-of-the-2004-devils-lake-wetland-management-district-roadside-transect-survey",nt"isopen":
    false,nt"url": null,nt"notes": "This report is on the 2004 road transect
    surveys conducted on the Devils Lake Wetland Management District.  Surveys were
    preformed in an effort to fill the data gap and obtain necessary information for
    developing the District's Comprehensive Conservation Plan on non-game migratory
    bird species.  The specific objectives of the survey are to inventory waterbird,
    shorebird and upland birds and to provide data to the Habitat and Population Evaluation
    Team (HAPET) for the development of waterbird and shorebird habitat models.",nt"license_title":
